import { Component } from 'react'
import { connect } from 'react-redux'
import { setButtonNumber } from '../store/hooks'
import { Button } from 'react-bootstrap'

interface Props {
    page: {
        button_number: number
    }
    setButtonNumber: any
}

class Try extends Component<Props>{

    button_number: number = this.props.page.button_number
    setButtonNumber = this.props.setButtonNumber

    constructor(props: any) {
        super(props)

        console.log(this.props)
    }

    render = () => {


        return (
            <div className="App">
                <h1>Number : {this.button_number}</h1>
                <Button onClick={() => this.setButtonNumber()}>Add</Button>
            </div>
        )
    }
}

const mapStateToProps = (state: any) => ({
    page: state.page
})

const mapDispatchToProps = (dispatch: any) => {
    return { setButtonNumber: () => dispatch(setButtonNumber()) }
}

export default connect(mapStateToProps, mapDispatchToProps)(Try)
